import React, { useState } from "react";
import {
    Container,
    Typography,
    Paper,
    Box,
    Grid,
    Card,
    CardContent,
    CardMedia,
    Button,
    Chip,
    Accordion,
    AccordionSummary,
    AccordionDetails,
} from "@mui/material";
import ExpandMoreIcon from "@mui/icons-material/ExpandMore";

const OrderHistoryPage = () => {
    const [orders, setOrders] = useState([
        {
            id: 0,
            city: "Москва",
            street: "Тверская",
            house: "10",
            apartment: "5",
            phoneNumber: "+79999999999",
            status: "PROCESS",
            date: "2025-01-29",
            orders: [
                {
                    id: 0,
                    count: 2,
                    food: {
                        id: 0,
                        title: "Pizza Margherita",
                        description: "Classic Italian pizza with tomatoes and cheese",
                        allergens: "Gluten, Dairy",
                        grams: 300,
                        price: 500,
                        image: "https://via.placeholder.com/150",
                        favorited: true,
                        category: { id: 1, name: "Pizza" },
                    },
                },
                {
                    id: 1,
                    count: 1,
                    food: {
                        id: 1,
                        title: "Sushi Rolls",
                        description: "Fresh sushi rolls with salmon",
                        allergens: "Fish, Rice",
                        grams: 200,
                        price: 350,
                        image: "https://via.placeholder.com/150",
                        favorited: false,
                        category: { id: 2, name: "Sushi" },
                    },
                },
            ],
        },
        {
            id: 1,
            city: "Санкт-Петербург",
            street: "Невский проспект",
            house: "20",
            apartment: "12",
            phoneNumber: "+78888888888",
            status: "COMPLETED",
            date: "2025-01-27",
            orders: [
                {
                    id: 2,
                    count: 3,
                    food: {
                        id: 2,
                        title: "Burger",
                        description: "Juicy beef burger with lettuce and cheese",
                        allergens: "Gluten, Dairy",
                        grams: 400,
                        price: 450,
                        image: "https://via.placeholder.com/150",
                        favorited: false,
                        category: { id: 3, name: "Fast Food" },
                    },
                },
            ],
        },
    ]);

    const getStatusColor = (status) => {
        switch (status) {
            case "PROCESS":
                return "warning";
            case "COMPLETED":
                return "success";
            case "CANCELLED":
                return "error";
            default:
                return "default";
        }
    };

    return (
        <Box
            sx={{
                minHeight: "100vh",
                display: "flex",
                alignItems: "center",
                justifyContent: "center",
            }}
        >
            <Container maxWidth="lg">
                <Paper
                    elevation={10}
                    sx={{
                        padding: 5,
                        borderRadius: 3,
                        backdropFilter: "blur(10px)",
                        backgroundColor: "rgba(255, 255, 255, 0.1)",
                        boxShadow: "0px 4px 20px rgba(0, 0, 0, 0.3)",
                        border: "1px solid rgba(255, 255, 255, 0.3)",
                        margin: "50px",
                    }}
                >
                    <Typography variant="h4" component="h1" sx={{ fontWeight: "bold", color: "#fff" }}>
                        История заказов
                    </Typography>

                    {orders.map((order) => (
                        <Accordion key={order.id} sx={{ backgroundColor: "rgba(255, 255, 255, 0.1)", marginTop: 2 }}>
                            <AccordionSummary expandIcon={<ExpandMoreIcon sx={{ color: "#fff" }} />}>
                                <Box sx={{ display: "flex", flexDirection: "column", width: "100%" }}>
                                    <Typography variant="h6" sx={{ color: "#fff" }}>
                                        Заказ №{order.id} ({order.date})
                                    </Typography>
                                    <Typography variant="body2" sx={{ color: "#bbb" }}>
                                        Адрес: {order.city}, {order.street}, д. {order.house}, кв. {order.apartment}
                                    </Typography>
                                    <Typography variant="body2" sx={{ color: "#bbb" }}>
                                        Телефон: {order.phoneNumber}
                                    </Typography>
                                    <Chip label={order.status} color={getStatusColor(order.status)} sx={{ marginTop: 1, width: 120 }} />
                                </Box>
                            </AccordionSummary>

                            <AccordionDetails>
                                <Grid container spacing={3}>
                                    {order.orders.map((item) => (
                                        <Grid item xs={12} sm={6} md={4} key={item.id}>
                                            <Card
                                                sx={{
                                                    borderRadius: 3,
                                                    overflow: "hidden",
                                                    backdropFilter: "blur(10px)",
                                                    backgroundColor: "rgba(255, 255, 255, 0.1)",
                                                    boxShadow: "0px 4px 15px rgba(0, 0, 0, 0.2)",
                                                    cursor: "pointer",
                                                }}
                                            >
                                                <CardMedia
                                                    component="img"
                                                    alt={item.food.title}
                                                    image={item.food.image}
                                                    sx={{
                                                        height: 270,
                                                        objectFit: "cover",
                                                        width: "100%",
                                                    }}
                                                />
                                                <CardContent sx={{ color: "#fff" }}>
                                                    <Typography variant="h6">{item.food.title}</Typography>
                                                    <Typography variant="body2" sx={{ color: "#bbb" }}>
                                                        {item.food.description}
                                                    </Typography>
                                                    <Typography variant="body2" sx={{ color: "#bbb" }}>
                                                        Аллергены: {item.food.allergens}
                                                    </Typography>
                                                    <Typography variant="body2" sx={{ color: "#fff", fontWeight: "bold" }}>
                                                        {item.food.price} ₽
                                                    </Typography>
                                                    <Typography variant="body2" sx={{ color: "#bbb" }}>
                                                        Количество: {item.count}
                                                    </Typography>
                                                </CardContent>
                                            </Card>
                                        </Grid>
                                    ))}
                                </Grid>
                            </AccordionDetails>
                        </Accordion>
                    ))}
                </Paper>
            </Container>
        </Box>
    );
};

export default OrderHistoryPage;
